Т—Ж  — это бесплатное приложение Тинькофф Журнала, самого большого в России журнала про деньги. Оно для всех, кто хочет хорошо жить и грамотно обращаться с финансами.

Внутри приложения — статьи про деньги, Учебник и Расчеты. 

В Журнале исследуем, как стать богаче, защищать свои права, растить детей, путешествовать и покупать недвижимость. А еще рассказываем, как не разориться на здоровье, зарабатывать на своем деле и водить авто.

В Учебнике — курсы о жизни и деньгах с короткими уроками на темы от инвестиций до экологии, жизненные примеры и много интерактива: тесты и экзамены. Все просто и понятно, без унылой теории и снобизма. 

Здесь можно научиться массе полезных штук, которые придадут уверенности хоть на бирже, хоть в ЖЭКе. Вот что можно узнать прямо сейчас:

— зарабатывать на инвестициях;
— пользоваться кредиткой, чтобы банки платили вам;
— с умом брать и быстро закрывать ипотеку;
— вычислять мошенников в интернете и жизни;
— путешествовать во время пандемии;
— не разориться на здоровье;
— заботиться об экологии;
— воспитывать собаку.

Все уроки Учебника можно проходить в комфортном темпе, каждый займет не больше 15 минут вашего времени. 

В Расчетах — простые калькуляторы, которые помогают принимать финансовые решения, основываясь на цифрах, а не на интуиции. Полученные результаты сохранятся в профиле и всегда будут под рукой.

16 миллионов человек уже читают нас, и миллион студентов проходит наши курсы: присоединяйтесь к их числу, чтобы стать магистром финансовой грамотности.
